import { Link } from "react-router-dom";
import "../styles/navBar.css";

export default function NavBar() {
  return (
    <div className="nav">
      <div>
        <Link to="/create" className="Link">
          Create game
        </Link>
      </div>
      <Link to="/games">Home</Link>
    </div>
  );
}
